import './index.css';

function App(){
    function inputEvent(event){
        console.log("clicked");
    }
    return (<>
        <div>
            <h1>Hello</h1>
            <input type='text' placeholder='Enter your name'
                onChange={inputEvent}
            />
            <button>Submit</button>
        </div>
    </>);
}
export default App;
